import "./App.css";
import { ClienteClient } from "./pb/subastas_grpc_web_pb"

var client = ClienteClient("http://localhost:8000")

function App(){

  const getCliente = () => {
    client.getCliente({id:"1"}, (e, r) => console.log(e, r))
    console.log("hoola rick")
  }

  return(
    <div className="App">
      <h1> Hello, World! </h1>
      <button href="#" onClick={getCliente}>Clickeame</button>
    </div>
  );
}

export default App;
